results:
  Age:
    code:
    - - .isComplete('Age')
      - Passed
    - - .isNonNegative('Age')
      - Failed
  Medical Condition:
    code:
    - - .isComplete('Medical Condition')
      - Passed
    - - .isContainedIn('Medical Condition', ['Cancer', 'Diabetes', 'Hypertension',
        'Obesity', 'Arthritis', 'Asthma'])
      - Passed
  Name:
    code:
    - - .isComplete('Name')
      - Passed
  id:
    code:
    - - .isUnique('id')
      - Passed
